import React from 'react';

const Notes = () => {

    return(
        <>
          <div className="write">
              <h1 className="title">Title </h1>
              <hr/>
              <p className="content">this is the content</p>
              <button className="mine">-</button>
          </div>  
        </>
    );
}

export default Notes;
